deck_description:
I first made this deck back in 2014 when I cam back to the game after a lengthy hiatus back when I played through duel network and I wanted to make a deck that used one of my favourite cards, Command Knight, so I searched through the data base for cards that would work well with it hitting upon a strategy that involved using Marauding Captain to form a lock stopping my weaker monsters from being destroyed in battle while powering them up through the effects of The A. Forces and Command Knight. Fast forward two (or maybe three? I'm getting forgetful in my old age) and pendulum summoning is just being released and my little lizard brain goes "no likey" so I decide to take another hiatus from the game (until either the Valkyries or Backup Gardna are released) up until the Steam winter sale at the end of last year where Yu-Gi-Oh Legacy of the Duelist: Link Evolution was on sale so I decided to pick it up and give it a play rediscovering my love for the game (still hate pendulum summoning though) and with that we arrive to the current incarnation of what is now a seven year old deck.

&nbsp;

&nbsp;

&nbsp;

The core tactic hasn't changed, you power up your weaker (and stronger) monsters through card effects while protecting them from battle with Marauding Captain. The original deck had Absolute Crusader, Sword Master and Dark Blade the Captain of the Evil World who have since been replaced (partly because I now have better options and partly because I actually forgot the actual contents of the deck) and obviously no link monsters, speaking of whichFerocious Flame Swordsmanis a big boon to the deck as it also powers up the warriors but can also resurrect fallen warriors if it's not in your extra monster zone while Black Luster Soldier - Soldier of Chaosacts as yet another boss monster but for the most part you'll be relying on your level 3 and 4 monsters to do most of the heavy lifting.

&nbsp;

The Attribute Knights are just there to make Black Luster Soldier - Envoy of the Beginning easier to access although there is a nice combo with an empty hand, Armageddon Knight, Swift Gaia the Fierce Knight and The Warrior Returning Alive where you summon Armageddon Knight, send Gaia then using The Warrior Returning Alive to then summon Gaia from your empty hand, not reliable by any means but a fun combo nonetheless. I will admit that I've not managed to test Dawn Knight in the deck yet but it shouldn't be too different to its dark counterpart.

If you don't know what clock is then I'll tell you, it's a small cyberse "archetype" that uses the card cynet fusion. I found out recently about how broken the link 2 clock lizard is.

&nbsp;

<span>So I’ve played a few matches, this deck is a going second consistent OTK deck that can play through about three negates (unless one is a nibru) before crumbling apart from my experience so far. I’ve been cleaning players clocks (pun totally intended) with one attack. You may argue with some of my choices but I believe that every card in the deck works the way I want it to but I’ll still be open for advice for things to add.</span>

&nbsp;

<span>In the guide below I’ll explain the list, why I picked the cards, and the combos</span>

&nbsp;

<span>List:</span>

&nbsp;

<span>3 clock wyvern (an absolutely necessary 3 of in this deck, you have 9 cards in the deck that’ll open it for you)</span>

&nbsp;

<span>1 RAM clouder (summons a cyberse from the grave, you can replace it with something like swap cleric)</span>

&nbsp;

<span>3 ROM cloudia (mainly for backup and converter, latency comes up, but rarely)</span>

&nbsp;

<span>3 lady debug (get converter or secretary to help start your main combo)</span>

&nbsp;

<span>3 cyberse gadget (I love this card for it’s ability to be 3 monsters in one, mainly to start combo)</span>

&nbsp;

<span>3 widget kid (two for one to start combo)</span>

&nbsp;

<span>3 backup secretary (powerful extender in this deck)</span>

&nbsp;

<span>3 defcon bird (graveyard setup and monster on the field)</span>

&nbsp;

<span>3 cyberse converter (quick body, extender or starter if necessary)</span>

&nbsp;

<span>3 swap cleric (none of the link monsters in this deck need their attack points because you’re giving them to clock dragons so it’s just an easy draw)</span>

&nbsp;

<span>1 stack reviver (extender, helped me out a lot)</span>

&nbsp;

<span>1 dotscaper (easy to get out on the field, it’s also a two for one so use it)</span>

&nbsp;

<span>1 latency (for the draw)</span>

&nbsp;

<span>3 cynet fusion (key card in the deck)</span>

&nbsp;

<span>3 cynet mining (search, sometimes clock wyvern, sometimes a way to get two monsters)</span>

&nbsp;

<span>3 fusion conscription (quick access to clock wyvern)</span>

&nbsp;

<span>2 cyberse clock dragon (win condition, one swing for the kill)</span>

&nbsp;

<span>1 diplexer chimera (safey and latency)</span>

&nbsp;

<span>1 code talker inverted (extender)</span>

&nbsp;

<span>3 clock lizard (heart and soul of the deck, I couldn’t have made this combo work without it, also it’s banish effect is not a once per turn so you can stack multiple if you used extenders)</span>

&nbsp;

<span>1 security dragon (if you used an extender then this can provide clearance)</span>

&nbsp;

<span>1 secure gardna (fusion material, explained later)</span>

&nbsp;

<span>1 clock spartoi (cynet fusion search)</span>

&nbsp;

<span>1 link devotee (despicable-devotee)</span>

&nbsp;

<span>1 link despicable (despicable-devotee)</span>

&nbsp;

<span>1 linkguriboh (for the big dragon)</span>

&nbsp;

<span>1 linkuribloh (for the big dragon)</span>

&nbsp;

<span>The combo: </span>

&nbsp;

<span>Materials: clock wyvern and a way to get two cyberses out (gadget also works in this spot), go second, it’s okay to have the clock wyvern in your hand because of fusion conscription.</span>

&nbsp;

<span>Summon the two cyberses</span>

&nbsp;

<span>Link cyberse one to make despicable</span>

&nbsp;

<span>Link cyberse two to make devotee</span>

&nbsp;

<span>Despicable eff tribute devotee to draw one and put one on the bottom</span>

&nbsp;

<span>Devotee summons two tokens</span>

&nbsp;

<span>Link one token for linkuriboh</span>

&nbsp;

<span>Link likuriboh and despicable for clock spatoni</span>

&nbsp;

<span>Spatoni searches cynet fusion (whatever you do do not use spatoni’s second effect)</span>

&nbsp;

<span>Link other token for linguriboh</span>

&nbsp;

<span>Link linguriboh to make secure guardna</span>

&nbsp;

<span>Activate cynet fusion to fuse guardna with clock wyvern for a cyberse clock dragon</span>

&nbsp;

<span>Link clock dragon with spatoni to make clock lizard</span>

&nbsp;

<span>Lizard eff tribute self put clock dragon into extra deck then banish every link monster in your grave to make cyberse clock dragon again</span>

&nbsp;

<span>Clock dragon then chain lizard</span>

&nbsp;

<span>Lizard weakens all special summoned monsters your opponent owns by 400 points for every cyberse in the grave</span>

&nbsp;

<span>Clock dragon mills cards on top of the deck to the grave for every link rating (link 2 = two cards for example) you used to summon it, if the combo was done normally then you’ll send 9 cards, for every card milled you gain 1000 attack points (if combo done normally then this totals up to 11500), attack a weakened monster and win game</span>

&nbsp;

<span>Alt note, if you have two spare cyberses in your hand you can use cynet fusion to fuse them to summon your diplexer then have it tribute itself, lock the spells and traps out of the battle phase and recycle cynet fusion.</span>

&nbsp;

<span>Alt note, use the extenders to help get more link monsters in the grave if possible to boost your clock dragon, clock lizard’s banished effect is not once per turn so you can use it multiple times in a turn allowing for you to stack a lot of debuffs and make it so that you to swing for game more easily.</span>

&nbsp;

<span>I love the deck, the combo took some time to get used to but overall it’s really good and I find I'm able to end games very quickly and consistently using this combo.</span>

&nbsp;

<span>(my record is 17500, if you use this deck then tell me yours!)</span>

Behold - My attempt at a Code Talker/generic Cyberse deck! This is my first deck submitted here (or ever), so some feedback is greatly appreciated!

Thanks to some feedback, I was able to revise the deck's playstyle a bit. It originally used a Cynet Fusion engine. Now, its main strategy is to swarm the field with Link monsters to give both offense and defense (maybe an Extra Link at the end if you're lucky) the first turn and win the Duel on the third turn.

&nbsp;
